Todas as dificuldades que eu passei na minha vida não me deixaram esmorecer, tive que ter muita resiliência pois eu sabia que as crianças não aprendiam com o que falávamos e sim, com os exemplos, com as nossas ações. Eu queria que você visse em mim uma mulher que fosse te influenciar, servir de inspiração para você no futuro.. para que você se tornasse uma mulher forte e independente. 
Mas hoje, olhando para você completando 21 anos e vendo você me inspirando, me influenciando e me ensinando tanto, me enche de orgulho e gratidão. Te amo ❤️🧁

